// About.js
import React from 'react';
import '../styles/about.css';

function About() {
  return (
    <div className="about-container">
      <h2 className="about-title">О нас</h2>
      <p className="about-content">Мы — компания, которая стремится к качеству и инновациям. С нашими проектами и инициативами мы стремимся сделать мир лучше!</p>
    </div>
  );
}

export default About;
